import React from "react";
import classes from "./MealCart.module.css";
const MealCart = (props) => {
  return (
    <section className={`${classes.cart} ${props.className}`}>
      <ul>
        <li>{props.children}</li>
      </ul>
    </section>
  );
};

export default MealCart;
